num_of_fails = 0

# Open a CSV file to write
with open('snack_info.csv', 'w', newline='', encoding='utf-8') as csvfile:
    writer = csv.writer(csvfile)
    writer.writerow(['title', 'rating', 'price', 'image', 'description', 'ingredients', 'reviews', 'url'])

    urls = set(urls)

    for url in urls:
        response = requests.get(url, custom_headers)

        if response.status_code == 200:
            # print('Success')
            # soup = BeautifulSoup(response.content, 'html.parser')
            soup = BeautifulSoup(response.text, 'lxml')

            #####Create selector for product title
            title_element = soup.select_one('#productTitle')

            title = title_element.text.strip()

            ######create selector for rating

            span_element = soup.find('span', class_='') # I added this

            rating_element = soup.select_one('#acrPopover')

            if rating_element is not None:
              rating_text = rating_element.attrs.get('title') #rating value is the text attribute of the rating element
              rating = rating_text.replace('out of 5 stars', '') #get just the rating and exclude 'out of 5 stars'
            else: 
               rating_text = None
               rating = None

            ####Create selector for price
            price_element = soup.select_one('span.a-price').select_one('span.a-offscreen') #a-offscreen is the class of the span

            #### scrap default image
            image_element = soup.select_one('#landingImage') #image id is landingImage

            image = image_element.attrs.get('src') #src attribute of img

            #### Scraping Product description
            
            description_element = soup.select_one('#feature-bullets')
            if description_element is not None:
              description = description_element.text
            else: 
               description = None
            #### Scraping ingredients
            
            important_info_div = soup.find('div', id='important-information')
            # print(important_info_div)
            if important_info_div:
            # Find all div elements with class 'a-section-content' within 'important-information' div
              a_section_content_divs = important_info_div.find_all('div', class_='a-section')
              # print(a_section_content_divs)
              ingredient_list = ''
              for div in a_section_content_divs:
              # Check if the text contains 'ingredient' (you might need to adjust this condition based on the actual content)
                subheading = div.select_one("span.a-text-bold")
                if subheading is not None: 
                  subheading = subheading.text
                  if 'ingredients' == subheading.lower():
                    ingredients = div.get_text().strip()
                    ingredient_string_without_ingredients = re.sub(r'Ingredients', '', ingredients)
                    # Removing words within parentheses
                    ingredient_string_without_parentheses = re.sub(r'\([^)]*\)', '', ingredient_string_without_ingredients) 

                    ingredient_list += ingredient_string_without_parentheses.strip()             


            #### Scraping Product review
            review_elements = soup.select_one('#feature-bullets')
            description = description_element.text.strip() if description_element else None

            review_elements  = soup.select("div.review")

            scraped_reviews  = []

            for review in review_elements:
              r_author_element = review.select_one("span.a-profile-name")
              r_author = r_author_element.text if r_author_element else None
  
              r_rating_element = review.select_one("i.review-rating")
              r_rating = r_rating_element.text.replace("out of 5 stars", "") if r_rating_element else None

              r_title_element = review.select_one("a.review-title")
              r_title_span_element = r_title_element.select_one("span:not([class])") if r_title_element is not None else None
              r_title = r_title_span_element.text if r_title_span_element is not None else None
              # print(r_title)

              r_content_element = review.select_one("span.review-text")
              r_content = r_content_element.text if r_content_element else None
              if r_content_element:
                r_content = re.sub(r"(\n|\\n|Read more)", "", r_content)


              r_date_element = review.select_one("span.review-date")
              r_date = r_date_element.text if r_date_element else None

              r_verified_element = review.select_one("span.a-size-mini")
              r_verified = r_verified_element.text if r_verified_element else None

              r = {
                "author": r_author,
                "rating": r_rating,
                "title": r_title,
                "content": r_content,
                "date": r_date,
                "verified": r_verified

                }
              scraped_reviews.append(json.dumps(r))

            writer.writerow([title, rating, price_element.text, image, description, ingredient_list, "; ".join(scraped_reviews), url])
        else:
            # print(f"Failed to retrieve the webpage: {url}. Status code: {response.status_code}")
            num_of_fails += 1

print(f'Scraped {len(urls) - num_of_fails} product')



